import React, { useState, useEffect } from 'react';
import { fetchCarsInRange } from './api';

const CarCatalog = () => {
  const [cars, setCars] = useState([]);

  useEffect(() => {
    const loadCars = async () => {
      const data = await fetchCarsInRange('1-20');
      setCars(data);
    };

    loadCars();
  }, []);

  return (
    <div>
      {cars.length > 0 ? (
        cars.map((car) => (
          <div key={car.id}>
            <h3>{car.brand} {car.model}</h3>
            <img src={`http://localhost:5004${car.image}`} alt={car.model} />
          </div>
        ))
      ) : (
        <p>Машини не знайдені</p>
      )}
    </div>
  );
};

export default CarCatalog;
